import axios from "axios";
import React, { useState, useEffect } from "react";

function AdminOrder() {
	const [OrderList, SetOrderList] = useState([]);

	useEffect(() => {
		let A = 0;
		let B = 0;
		let C = 0;
		let D = 0;

		for (let i = 0; i < 100; i++) {
			let randomnumber = Math.random();
			if (randomnumber > 0 && randomnumber < 0.25) {
				A++;
			}
			if (randomnumber > 0.25 && randomnumber < 0.5) {
				B++;
			}
			if (randomnumber > 0.5 && randomnumber < 0.75) {
				C++;
			}
			if (randomnumber > 0.75 && randomnumber < 1) {
				D++;
			}
		}
		console.log("A: " + A + " B: " + B + " C: " + C + " D: " + D);

		axios.post("http://localhost:3001/api/GetOrders").then((response) => {
			SetOrderList(response.data);
			console.log(response.data);
		});
	}, []);
	return (
		<div>
			{OrderList.map((info, index) => {
				return <div key={index}>{info.id}</div>;
			})}
		</div>
	);
}

export default AdminOrder;
